INSERT INTO `about_bodolandseed` (`id`, `image`, `head`, `title`, `description`) VALUES
(5, 'images/aboutBodolandSeed/dd521ef4d1d010370c42e5394144d52aseed-btr-black.png', ' SKILL EMPLOYMENT AND ENTREPRENEURSHIP DEPARTMENT SEED BTR AN INITIATIVE OF BTR GOV.  ', 'About Bodoland SEED Mission', '<h4 class=\"mb-20 fz-45 fw-700\" style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(59, 63, 130);font-family:&quot;Noto Sans&quot;, sans-serif;font-size:45px !important;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:700 !important;letter-spacing:normal;line-height:1.6;list-style:none;margin:0px 0px 20px !important;orphans:2;outline:none;padding:0px;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"><span style=\"font-size:13px;\"><span class=\"sub-title\" style=\"box-sizing:border-box;display:inline-block;letter-spacing:2px;list-style:none;margin:0px 0px 15px;outline:none;padding:0px;text-align:left;text-transform:uppercase;\">THE BODOLAND SKILL EMPLOYMENT &amp; ENTREPRENEURSHIP DEVELOPMENT MISSION HAS BEEN INAUGURATED ON 14TH DECEMBER 2021 AND THE PROCESS IS GOING TO MAKE IT AS A SOCIETY FOR PROVIDING A GOOD QUALITY SKILL ECO-SYSTEM TO THE YOUTH OF BODOLAND TERRITORIAL REGION (BTR). BTR SEED MISSION SHALL BE ESTABLISHED FOR PROVIDING A GOOD QUALITY SKILL ECO SYSTEM TO THE YOUTH OF BTR. BTR SEED MISSION SHALL BE RESPONSIBLE FOR COORDINATION OF ALL SKILL DEVELOPMENT EFFORTS ACROSS BTR REGION, EXCLUSION OF DISCONNECT BETWEEN DEMAND AND SUPPLY OF SKILLED MANPOWER, BUILDING THE VOCATIONAL AND TECHNICAL TRAINING FRAMEWORK, SKILL ENHANCEMENT, STRUCTURING OF NEW SKILLS, AND PIONEERING THINKING NOT ONLY FOR EXISTING JOBS BUT ALSO JOBS THAT ARE TO BE CREATED BY ENGAGING YOUNG PEOPLE FROM BTR REGION. IT SHALL AIM TO ACHIEVE THE VISION OF A SKILLED BTR WHICH WILL BRING HAPPINESS AMONGST PEOPLE OF THE REGION.</span></span></h4>');
