(8, 'images/background/55b61663a03d450fafa79088e85e253dstragey-about.PNG', 'images/background/55b61663a03d450fafa79088e85e253d522565940.jpg', 'BACKGROUND OF SKILL EMPLOYMENT AND ENTREPRENEURSHIP DEPARTMENT', 'Background', '<h4 class=\"mb-20 fz-45 fw-700\" style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(59, 63, 130);font-family:&quot;Noto Sans&quot;, sans-serif;font-size:45px !important;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:700 !important;letter-spacing:normal;line-height:1.6;list-style:none;margin:0px 0px 20px !important;orphans:2;outline:none;padding:0px;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"><span style=\"font-size:13px;\"><span class=\"sub-title\" style=\"box-sizing:border-box;display:inline-block;letter-spacing:2px;list-style:none;margin:0px 0px 15px;outline:none;padding:0px;text-transform:uppercase;\">THE BODOLAND TERRITORIAL AREA DISTRICTS (BTAD) IS AN AUTONOMOUS REGION LOCATED IN THE STATE OF ASSAM IN INDIA. THE BODOLAND SKILL EMPLOYMENT AND ENTREPRENEURSHIP DEPARTMENT (BSEED) WAS CREATED IN 2017 AS PART OF THE BODOLAND TERRITORIAL COUNCIL (BTC) WITH THE MISSION TO DEVELOP AND IMPLEMENT STRATEGIES FOR PROMOTING SKILL DEVELOPMENT, EMPLOYMENT GENERATION, AND ENTREPRENEURSHIP IN THE REGION.</span></span></h4>', '2024-05-21');
