INSERT INTO `events` (`id`, `image`, `head`, `address`, `description`, `date_uploaded`) VALUES
(18, 'images/Events/10eba35ca763bd3e960ad42f0dc1f980e1.jpg', 'Inauguration Ceremony of SSC / BANKING / RAILWAYS Coaching Programme 2023-24', '<p>Kokrajhar</p>', '<p>Inauguration Ceremony of Ssc / Banking / Railways Coaching Programme for youths of Bodoland Territorial Region (BTR) , under the skill employment and entrepreneurship department (SEED) mission BTC, kokrajhar . The Event , held under the august presence of Wilson Hasda , Excecutive Member of Bodoland Territorial Council ,Assam ; along with the joint secretary, director, advisor, &nbsp;and registrar of SEED BTR , underscored a &nbsp;collective commitment to naturing the region\'s talent pool, Graced by the esteemed presence of visionary leader and director of CSAP , IAS Academy , Shri Rajdeep Lekharu, the ceremony marked a pivotal moment in fostering eductaion and opportunities for the vibrant youth of BTR</p>', '2024-05-21'),
(19, 'images/Events/cd856e83496f0927eede661fa0b69592e2.jpg', 'Empowering through education: Inauguration of faculty development programme in BTR', '<p>Bodofa Nagar, Kokrajhar</p>', '<p>We are thrilled to announce the inauguration of a faculty development programme organized by skill, employment &amp; entrepreneurship department in Bodoland Territorial Region (BTR). The event was inaugurated by BTR Executive Member , Wilson Hasda, showcasing a strong commitment &nbsp;to skill development in the region.Supported by ministry &nbsp;of skill development &amp; entrepreneurship , along with directorate general of training central staff training and research institute (CSTARI) , the initiative aims to enhence the capabilities of educators and professionals. The programme scheduled from february 5 to february 9, is hosted at the 4th floor of the utility building in Bodofa Nagar, Kokrajhar . It brings together key figures like joint secretary to SEED , Shri Bhaskarjyoti Rajbongshi, Deputy director cum CHD, Shri Pranjit Das,and training officer Shri Budhaditya Biswas. Notable participetion from Goutam Nandi of the central staff training &amp; research institute in Kolkata, under MSDE , GOL, adds a valuable dimension to the collaboration efforts. This initiative marks &nbsp;a significant stride towords fostering skill development, employment and entrepreneurship in bodoland teritorial region. Stay tuned for updates on the impactful outcomes and advancements achived through this empowerment programme.</p>', '2024-05-22'),
(20, 'images/Events/6d265efd2174bcd8b326bc3edf5e7516e3.jpeg', 'Empowering communities  through self-employment :Launch of self-employed linked short-term training programme', '<p>NRDS campus, khoirabari</p>', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);font-family:Montserrat, sans-serif;font-size:14px;\"><span style=\"-webkit-text-stroke-width:0px;display:inline !important;float:none;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:500;letter-spacing:normal;orphans:2;text-align:justify;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">We are thrilled to announce the inauguration of the Self-Employed Linked Short-Term Training Program and Toolkit Distribution Ceremony at the NRDS campus in Khoirabari today. This pioneering initiative is set to transform the lives of unemployed youth in the region, providing them with invaluable skills and opportunities to establish themselves as self-employed individuals. Courses Offered: The training program, spearheaded by SEED (Self-Employment and Entrepreneurship Development), BTC (Bodoland Territorial Council), and guided by the Hon\'ble CEM Shri Pramod Boro Dangoriya, focuses on three key areas: Self-Employed Tailor: Offering a comprehensive course for individuals interested in the art of tailoring and fashion design, equipping them with the skills to thrive in the competitive market. Assistant Electrician: Providing practical training in electrical work, this course aims to create a pool of skilled assistants in the field of electrical services, addressing the growing demand for qualified professionals. Plumber General: Focusing on plumbing skills, this course empowers individuals to become proficient plumbers, contributing to the community\'s needs for reliable plumbing services. Empowering the Youth: The initiative is designed to empower and train a significant number of individuals, fostering self-employment within the community. By addressing the specific needs of the region and aligning the courses with market demands, we aim to bridge the gap between unemployment and meaningful self-employment. Guided by Visionary Leadership: Under the visionary guidance of the Hon\'ble Chief Executive Member, Shri Pramod Boro Dangoriya, this initiative is a testament to the commitment to community development. His leadership has ensured that the program not only imparts skills but also nurtures the entrepreneurial spirit of the participants. Join Us in Building a Self-Reliant Community: We invite all enthusiastic individuals in the region to participate in this transformative program. Together, let\'s build a self-reliant community by providing the youth with the tools they need to succeed in their chosen self-employed ventures. This initiative marks a significant step towards a brighter and more prosperous future for the region. We look forward to witnessing the positive impact of the Self-Employed Linked Short-Term Training Program on individuals, families, and the community as a whole. Join us on this journey of empowerment and self-sufficiency!</span></span></p>', '2024-05-22'),
(21, 'images/Events/55f35026684c080d33e735662abca081e4.jpg', 'Empowering the North East: Launch of Special Skill Development Programme', '<p>kokrajhar</p>', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);font-family:Montserrat, sans-serif;font-size:14px;\"><span style=\"-webkit-text-stroke-width:0px;display:inline !important;float:none;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:500;letter-spacing:normal;orphans:2;text-align:justify;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">The North Eastern states of India have always been a region of rich cultural heritage, breathtaking landscapes, and a vibrant population. However, these states have often faced challenges in terms of economic development and opportunities for their youth. Recognizing the need to uplift this region and provide a pathway for the youth towards a brighter future, the Hon\'ble Minister of Skill Development and Entrepreneurship in the Government of India, Shri Dharmendra Pradhan, launched the Special Skill Development Programme with the theme \"Transforming lives, building futures.\" The launch event was a significant step towards equipping the youth of the North Eastern states with the skills and knowledge required to excel in the modern workforce. Attending the programme online, The Seed, an organization dedicated to fostering growth and innovation in the region, showed its commitment to this transformative initiative. During the event, Shri Jayanta Malla Baruah, the Honâ€™ble Minister of Skill to the Government of Assam, addressed the attendees, emphasizing the importance of skill development in shaping a prosperous future for the North East. His words resonated deeply, underlining the collective effort required to bring about positive change in the lives of the people. The event was graced by the presence of several key dignitaries and officials, including representatives from various departments such as Joint Secretary of Seed, officials from CHD Seed, Chd Handloom and Textile, CHD Agriculture, Industries department, and superintendents of ITIs (Industrial Training Institutes) from Kajalgaon, Kazigoan, and Ballamguri. Their presence highlighted the collaborative approach adopted by different sectors to ensure the success of this transformative programme. The Special Skill Development Programme aims to bridge the gap between education and employability by imparting practical skills that are in demand in today\'s rapidly evolving job market. With a focus on providing training in diverse fields such as agriculture, textile, and handloom, the programme is tailored to the unique strengths and opportunities of the North Eastern states. As we move forward, it is evident that this programme has the potential to reshape the future of the North East, creating a skilled and empowered workforce that contributes to both regional and national growth. The launch event marked the beginning of a journey towards transforming lives and building futures in the North Eastern states, setting the stage for a brighter and more prosperous tomorrow. In conclusion, the launch of the Special Skill Development Programme for the North Eastern states stands as a testament to the government\'s commitment to unlocking the immense potential of this region. With the theme \"Transforming lives, building futures,\" this initiative has the power to uplift communities, empower the youth, and create a more inclusive and vibrant North East. Through collaboration, dedication, and skill-building, the region is poised to chart a new course towards progress&nbsp;and&nbsp;prosperity.</span></span></p>', '2024-05-22'),
(22, 'images/Events/c67f4c4c4b88063787c34145a38bd94ce5.jpg', 'The Entrepreneurship Skill Development Program was successfully conducted on Kokrajhar', '<p>kokrajhar</p>', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);font-family:Montserrat, sans-serif;font-size:14px;\"><span style=\"-webkit-text-stroke-width:0px;display:inline !important;float:none;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:500;letter-spacing:normal;orphans:2;text-align:justify;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">On 21st September 2021 a Pradhan Mantri Van Dhan Yojona - Entrepreneurship Skill Development Programme (PMVDY-ESDP) conducted training on food processing and training on Value added of Erie Cocoon and Jacquard Handloom and it was successfully completed at two locations, namely Pachim-Maligaon VDVKC and Kachugaon VDVKC, Kokrajhar, India.</span></span></p>', '2024-05-22'),
(23, 'images/Events/97a0c4f50d5584a22b096e366d3695d9e6.jpg', 'BTC Chief Pramod Boro launches online grievance redressal system in Kokrajhar.', '<p>kokrajhar</p>', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);font-family:Montserrat, sans-serif;font-size:14px;\"><span style=\"-webkit-text-stroke-width:0px;display:inline !important;float:none;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:500;letter-spacing:normal;orphans:2;text-align:justify;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">KOKRAJHAR: With the aim and objective of digitizing the Bodoland Territorial Council (BTC), a web portal for online grievance redressal system was launched by BTC chief executive member Pramod Boro at BTC Secretariat in Kokrajhar on Friday. The web portal will be available in English, Bodo, Assamese and Hindi.</span></span></p>', '2024-05-22'),
(24, 'images/Events/fe5ca0afcd92f81c246315b661225da6e7.jpg', 'The skilled women of Bodoland', '<p>kokrajhar</p>', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);font-family:Montserrat, sans-serif;font-size:14px;\"><span style=\"-webkit-text-stroke-width:0px;display:inline !important;float:none;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:500;letter-spacing:normal;orphans:2;text-align:justify;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">A slow afternoon in Bodoland offers a variety of sounds â€“ the gurgle of a nearby stream, the gentle rustle of leaves stirred by breeze, the clucking of hens, the jangle of cow-bells.</span></span></p>', '2024-05-21'),
(25, 'images/Events/87b3a472b2eacc81ea4f97ebb2ed0b0de8.jpeg', 'Bodoland education and skill development private limited', '<p>kokrajhar</p>', '<p>Bodoland education and skill development private limited is and Indian , non Government company. It\'s private company ans is classified as company\'s authorized capital stands at Rs. 10.0 Lakhs and has 100.0% paid up capital which is Rs. 10.0 lakhs. Bodoland Education and Skill Development Private Limited is majorly in community, personal , &amp; social Services business and currently company operations are active.</p>', '2024-05-22');
