INSERT INTO `press` (`id`, `image`, `head`, `address`, `description`, `date_uploaded`) VALUES
(13, 'images/Press/072e5103b0c23b08017be2027a15a271announcement.jpeg', 'Skill Development Thrives in Kokrajhar', '<p>Kokrajhar</p>', '<p>The event, organised by the Skill, Employment, and Entrepreneurship Department (SEED), was held on May 23, 2023, at the Auditorium Hall of Industrial Training Institute (ITI) Kokrajhar. The event witnessed the presence of the Chief Executive Member of Bodoland Territorial Council (BTC), Shri Pramod Boro; Executive Member of BTC, Shri Wilson Hasda; Executive Member of BTC, Dr Nilut Swargiary; Advisor to the SEED, Shri Ranjan K Baruah; Former MLA Tamulpur, Shri Chandi Basumatary; Joint Secretary SEED, Shri Bhaskar Jyoti Rajbongshi, ACS; Council Head of the SEED, Shri Pranjit Das; Project Head Assam of Anvil Cables Private Limited, Mr. Ujjwal Chaudhary; BTR Development Fellow, Miss Banrilang S. Kharsati. The CEM of Bodoland Territorial Region (BTR) has been emphasising bringing about faster and more sustainable socio-economic development in the BTR. In order to accomplish the development goals, the present BTC government has strategized to work in mission and target mode, thereby launching an ambitious 100 Days 150 Targets programme on May 4, 2023 where the BTR Development Fellowship will be working closely with the line departments in achieving the targets. The SEED has achieved one of the six targets of the department within 20 days since the launch of the 100 Days programme. Evening classes in the 3rd shift, where 164 trainees will be trained in 5 different trades, have commenced at ITI Kokrajhar. The department will also be providing skill training to 10,120 trainees in different job roles, which is also one of the department\'s six targets under the 100 Days targets. The SEED has taken several skilling initiatives and plans to roll out more this year. Apart from skilling, they also encourage students to take up entrepreneurship. As a first step to making them self-employed, the department will be giving the toolkit to 1163 trainees for the trades of electrician and self-employed tailor.</p>', '2023-07-14'),
(14, 'images/Press/4b816b82fc3bdc140ff148a8ca2ad418BTR CEm inu coaching.jpg', 'BTR CEM Inaugurates Coaching & Counseling Centre in Kokrajhar.', 'ITI, Dhaoliguri, Kokrajhar', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);font-family:Montserrat, sans-serif;font-size:14px;\"><span style=\"-webkit-text-stroke-width:0px;display:inline !important;float:none;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:500;letter-spacing:normal;orphans:2;text-align:justify;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Pramod Boro, the chief executive member of Bodoland Territorial Region (BTR), inaugurated the first-ever coaching and counselling centre developed by the Skill, Employment and Entrepreneurship Development Mission of the BTR government. The inauguration took place on Saturday, coinciding with the celebration of World Youth Skills Day, at the ITI Centre in Dhaoliguri, Kokrajhar. The initiative, under the SEED department of the BTR government, aims to create a ‘Skilled BTR’ by fostering talent, skills, and innovation among the region’s youth. The newly established centre, equipped with state-of-the-art facilities, will provide training through a hybrid mode,</span></span></p>', '2023-07-18'),
(15, 'images/Press/f6e7cd9c622e012dffe868373568593fassamgovt 10 colleghes.jpg', 'Assam Govt to Provincialize 10 Colleges in Bodoland Territorial Region (BTR)', '<p>Assam,Bodoland (BTR)</p>', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);font-family:Montserrat, sans-serif;font-size:14px;\"><span style=\"-webkit-text-stroke-width:0px;display:inline !important;float:none;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:500;letter-spacing:normal;orphans:2;text-align:justify;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">GUWAHATI: The Assam Cabinet meeting held in Korajhar on Tuesday saw the undertaking and discussions of many important decisions. The Government of Assam has been making efforts for quite a long time to highly prioritise the all-around development of the Bodoland Territorial Region (BTR).</span></span></p>', '2023-08-21');
INSERT INTO `programsprojects` (`id`, `image`, `head`, `description`, `date_uploaded`) VALUES
(18, 'images/programsProjects/7aa94bb05ecbcee7896040b383181d98empowring-prog-proj.jpeg', 'Empowering Futures: SEED\'s Workshop on Enhancing Employability Skills', '<p style=\"-webkit-text-stroke-width:0px;box-sizing:border-box;color:black;float:left;font-family:Montserrat, sans-serif;font-kerning:normal;font-size:14px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:500;letter-spacing:normal;line-height:22px;margin:0px 0px 10px;orphans:2;text-align:justify;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">In a concerted effort to prepare students for the competitive job market, the Skills Enhancement and Employability Development initiative, under the aegis of SEED, BTR, has been diligently conducting a series of workshops across colleges. These workshops, aimed at bolstering employability skills, commenced on November 1st and have already made a significant impact in over 12 colleges. The initiative is being carried out in collaboration with the Internal Quality Assurance Cell (IQAC) in some institutions and with the Career Counseling &amp; Placement Cell in others. The ongoing workshop series seeks to address the evolving needs of the workforce and equip students with the necessary skills to thrive in their future careers. The overarching goal is to reach a total of 23 provincialized colleges by the end of the program. Several colleges have already successfully completed the workshop, and the momentum is building as more institutions eagerly embrace this valuable opportunity. The workshops are thoughtfully designed to cover a wide spectrum of employability skills, including communication, critical thinking, problem-solving, teamwork, and adaptability. Practical insights from industry experts, interactive sessions, and hands-on activities ensure that participants not only gain theoretical knowledge but also develop practical skills that are essential in today\'s dynamic job market. The collaborative efforts between SEED, BTR, IQAC, and Career Counseling &amp; Placement Cells underscore the commitment to holistic student development. By leveraging the expertise of these entities, the workshops provide students with a comprehensive understanding of the professional landscape, enabling them to make informed career choices and excel in their chosen fields. With more than 12 colleges having successfully completed the program, the SEED initiative remains steadfast in its mission to reach the targeted 23 provincialized colleges. The enthusiastic response from both students and faculty reflects the growing awareness of the importance of enhancing employability skills for future success. As the program enters its final stretch, the organizers are determined to ensure that all designated colleges complete the workshop series by the end of the first week of December. The impact of these workshops is anticipated to resonate not only in the academic achievements of the participants but also in their future professional endeavors, contributing to a more skilled and employable workforce.</p><p style=\"-webkit-text-stroke-width:0px;box-sizing:border-box;color:black;float:left;font-family:Montserrat, sans-serif;font-kerning:normal;font-size:14px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:500;letter-spacing:normal;line-height:22px;margin:0px 0px 10px;orphans:2;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">SEED\'s Workshop on Enhancing Employability Skills stands as a testament to the power of collaborative efforts in shaping the future of our youth, preparing them to navigate the complexities of the professional world with confidence and competence.</p>', '2023-11-22'),
(19, 'images/programsProjects/d3fd71bd94f366e78d15399e1ef2140amake-in-porgram-proj.jpeg', 'Make in India', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);font-family:Montserrat, sans-serif;font-size:14px;\"><span style=\"-webkit-text-stroke-width:0px;display:inline !important;float:none;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:500;letter-spacing:normal;orphans:2;text-align:justify;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">\"Make in India\" is an ambitious initiative launched by the Government of India with the goal of transforming the country into a global manufacturing hub. The campaign seeks to promote investment, foster innovation, enhance skill development, and facilitate the production of goods within India. The primary objective of the Make in India initiative is to attract both domestic and foreign companies to invest in various sectors and establish their manufacturing units in India. By creating a favorable business environment, the government aims to boost employment opportunities, spur economic growth, and position India as a preferred destination for manufacturing and production activities. The campaign focuses on key sectors such as automobiles, textiles, pharmaceuticals, information technology, defense, renewable energy, and infrastructure. Special emphasis is placed on ensuring ease of doing business, simplifying regulatory procedures, and providing incentives and support to industries that choose to manufacture within the country. Make in India also emphasizes the importance of innovation and research and development (R&amp;D). The initiative encourages collaboration between industries, academia, and research institutions to foster a culture of innovation, develop cutting-edge technologies, and enhance the competitiveness of Indian products in the global market. Furthermore, the Make in India campaign recognizes the significance of skill development. Efforts are made to provide training and vocational education to enhance the skill sets of the workforce, ensuring a competent and adaptable labor pool capable of meeting the evolving demands of the manufacturing sector. The Make in India initiative has garnered significant attention and has resulted in increased foreign direct investment (FDI) inflows into the country. It has successfully showcased India\'s potential as a manufacturing powerhouse and has led to the establishment of numerous manufacturing units by both domestic and international companies. By promoting the manufacturing sector, the Make in India campaign aims to foster economic growth, create employment opportunities, and drive India\'s journey towards becoming a global manufacturing hub. The initiative serves as a testament to India\'s commitment to embracing industrialization, innovation, and inclusive development.</span></span></p>', '2023-03-01'),
(20, 'images/programsProjects/09399604a478798f56bf14ef35aca56cappret tran.jpeg', 'Apprenticeship Training', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);font-family:Montserrat, sans-serif;font-size:14px;\"><span style=\"-webkit-text-stroke-width:0px;display:inline !important;float:none;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:500;letter-spacing:normal;orphans:2;text-align:justify;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">The Apprentices Act, 1961 was enacted with the objective of regulating the programme of training of apprentices in the industry by utilizing the facilities available therein for imparting on-the-job training. The Act makes it obligatory for employers in specified industries to engage apprentices in designated trades to impart Apprenticeship Training on the job in industry to youth and person having National Trade certificate issued by National Council for Vocational Training (NCVT) to develop skilled manpower for the industry.</span></span></p>', '2023-03-01');
