INSERT INTO `schemes` (`id`, `image`, `head`, `title`, `description`, `date_uploaded`) VALUES
(11, 'images/schemes/b1a8337e83612cb9d3c0caf2f4765923scheme1.jpeg', 'Craftsmen Training Scheme (CTS)', 'craftmen scheme', '<p>The Craftmen Training Scheme (CTS) was introduced by Government of India in 1950 to ensure a steady flow of skilled workers in trades of domestic industry, to raise quantitatively and quantitatively the industry production by systematic training, to reduce unemployment among the educated youth by providing them employable skills , to cultivate and nature a technical and industrial attitude in minds of younger generation</p>', '2024-05-21'),
(12, 'images/schemes/78e19ac4d31f8049f89b743fb16e94dbscheme2.jpeg', 'Vocational Training Program for Women', 'Vocational Scheme', '<p>Women training under ministry of Skill Development &amp; Entrepreneurship takes care of providing skill training to women in the country which aims at stimulating employment opportunities among women of various socio-economic levels and different age groups. Women\'s vocational training Programme (WVTP) was designed and launched in 1977 to mainstream women into economic activities.This project on Women Vocational Training Programme was formulated with the assistance of Swedish International Development Aut.</p>', '2024-05-21'),
(13, 'images/schemes/6516af68dfcc4470aee44e94a1bd9033scheme3.jpeg', 'Craft Instructor Training Scheme ', 'CITS', '<p>Training of Craft Instructor is the mandated reponsibility of DGT and it has been operational since the inception of Craftmen Training Scheme (CTS) . Comprehensive training both in skills and training methodology is imparted to the instructor trainees to make them conversant with techniques of transfering hans on skills, to train skilled manpower for industry.</p>', '2024-05-21'),
(14, 'images/schemes/0969229f4d5fc88de5ca99aad0663350scheme4.jpeg', 'Pradhan Mantri Kaushal Vikas Yojana.', 'PMKVJ', '<p>Pradhan Mantri Kaushal Vikas Yojana (PMKVJ) is the flagship scheme of the ministry of skill development &amp; entrepreneurship (MSDE) implemented by National Skill Development Corporation . The Objective of this skill certification scheme is to enable a large number of Indian youth to take-up industry relevent skills training that will help them in securing a better livelihood . Individuals with prior learning experience of skills will also be assessed and certified under Recognition of Prior Learning (RPL).</p>', '2024-05-21'),
(15, 'images/schemes/e78537e45e2fc4b275d7d82ce500e7c0scheme5.jpeg', 'Avnanced Vocatinal Training Scheme', 'AVTS', '<p>In order to upgrade and update the skills of serving industrial workers , the AVTS is in operation since 1977. The Scheme was launched by erstwhile DGE&amp;T, Ministry of Labour and (now Directorate of General Training DGT , Ministry of skill development &amp; entrepreneurship) in collaboration with UNDP/ILO in 1977 at the then 6 advanced training institute (ATIs) under DGE&amp;T and 16 ITIs of the 15 states Governments.</p>', '2024-05-21'),
(16, 'images/schemes/6c3858eb8b063654828f267c217d3b09scheme6.jpeg', 'Rozgar Mela', 'occation of rozgar mela', '<p>The directorate of Employment &amp; Craftmen Training , Assam organizes JOB Mela / Rozgar Mela from time to time in various location accross Assam for benefit of the jobseekers. Under National Career Service (NCS), a Scheme under the Govt. of India . Job Meal/Rozgar Mela will be organized quarterly as per recuirements/ demands.</p>', '2024-05-21');
INSERT INTO `seedactivity` (`id`, `image`, `head`, `date_uploaded`, `description`, `place`) VALUES
(19, 'images/seedActivity/a46e4a1f24b3afe82fcec778b57c915ea8d21a41bd7da1b8aec5c45e0ae3153f10ff7f22b747817d931dbb19fa75ad75banner4.png', 'SEED Mission Logo Design Contest 2023', '2023-03-15', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);font-family:Montserrat, sans-serif;font-size:14px;\"><span style=\"-webkit-text-stroke-width:0px;display:inline !important;float:none;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:500;letter-spacing:normal;orphans:2;text-align:justify;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Kokrajhar: Bodoland SEED Mission is soon announcing LOGO Design Contest 2023, all tghe participants residing under BTR region can participate and win the prize of Rs. 50,000.</span></span></p>', 'Kokrajhar, BTR(Assam)'),
(20, 'images/seedActivity/19ba2b9c57acfac961f0e0d76655a72d8f60a021da2c76c39f6156e2c3a8c015BDSM2.jpg', 'Public consultation on skill, employment and entrepreneurship in Kokrajhar', '2023-03-29', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);font-family:Montserrat, sans-serif;font-size:14px;\"><span style=\"-webkit-text-stroke-width:0px;display:inline !important;float:none;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:500;letter-spacing:normal;orphans:2;text-align:justify;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">KOKRAJHAR: Public consultation on skill, employment and entrepreneurship got underway in the Bodoland Territorial Region (BTR) and the inaugural programme was held at Iragdao Community hall, Titaguri in Kokrajhar on Wednesday.</span></span></p>', 'Kokrajhar, BTR(Assam)'),
(21, 'images/seedActivity/9ac968a1aec9ba0d8717ea55ccd3f33f2469d625ac205bc4460f42d158a7f6adseeedmissionh.jpg', 'Launching ceremony of Skill, Emloyment and Entrepreneurship Mission', '2023-07-15', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);font-family:Montserrat, sans-serif;font-size:14px;\"><span style=\"-webkit-text-stroke-width:0px;display:inline !important;float:none;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:500;letter-spacing:normal;orphans:2;text-align:justify;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Initiative 1:</span></span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);font-family:Montserrat, sans-serif;font-size:14px;\"><span style=\"-webkit-text-stroke-width:0px;display:inline !important;float:none;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:500;letter-spacing:normal;orphans:2;text-align:justify;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">SEED Mission:</span></span><br><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);font-family:Montserrat, sans-serif;font-size:14px;\"><span style=\"-webkit-text-stroke-width:0px;display:inline !important;float:none;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:500;letter-spacing:normal;orphans:2;text-align:justify;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">RPL training of 4680 is done.</span></span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);font-family:Montserrat, sans-serif;font-size:14px;\"><span style=\"-webkit-text-stroke-width:0px;display:inline !important;float:none;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:500;letter-spacing:normal;orphans:2;text-align:justify;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">1828 nos. of on-going training in different trades such as airline cabin crew, JCB/Heavy vehicle driving, F&amp;B service etc.,br&gt; 1175 nos. toolkit will be distributed to trained candidates on 15th July in self-employed tailor &amp; assistant electrician trades.</span></span><br><br><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);font-family:Montserrat, sans-serif;font-size:14px;\"><span style=\"-webkit-text-stroke-width:0px;display:inline !important;float:none;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:500;letter-spacing:normal;orphans:2;text-align:justify;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Initiative 2:</span></span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);font-family:Montserrat, sans-serif;font-size:14px;\"><span style=\"-webkit-text-stroke-width:0px;display:inline !important;float:none;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:500;letter-spacing:normal;orphans:2;text-align:justify;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">10,120 target allotted by NSDC in different job role under PMKVY 4.0 in collaboration with IIE, Guwahati.7777</span></span></p>', 'Kokrajhar, BTR(Assam)');
