(7, 'images/seedMission/d107ab314ddf534df8b19402728fede2219698006.jpg', 'images/seedMission/d107ab314ddf534df8b19402728fede2about-mission.PNG', 'MISSION OF SKILL EMPLOYMENT AND ENTREPRENEURSHIP DEPARTMENT', 'Our Mission', '<h4 class=\"mb-20 fz-45 fw-700\" style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(59, 63, 130);font-family:&quot;Noto Sans&quot;, sans-serif;font-size:45px !important;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:700 !important;letter-spacing:normal;line-height:1.6;list-style:none;margin:0px 0px 20px !important;orphans:2;outline:none;padding:0px;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"><span style=\"font-size:13px;\"><span class=\"sub-title\" style=\"box-sizing:border-box;display:inline-block;letter-spacing:2px;list-style:none;margin:0px 0px 15px;outline:none;padding:0px;text-transform:uppercase;\">ENGAGING YOUNG PEOPLE INCLUDING STUDENTS AND ENHANCING THEIR TECHNICAL, COGNITIVE, BEHAVIOURAL, DIGITAL, VOCATIONAL AND LIFE SKILL FOR 21ST CENTURY SKILL REQUIREMENTS EARLY IN THEIR LIFE SO THAT THEY CAN DESIGN STRATEGY FOR SUCCES AND ENSURE DECENT JOBS, SELF EMPLOYMENT AND BRING SENSITIVE CHANGES IN THE REGION.</span></span></h4>', '2024-05-21');
