INSERT INTO `strategy` (`id`, `image1`, `image2`, `head`, `title`, `description`, `date_uploaded`) VALUES
(5, 'images/strategy/80754f9d671ed3265fd18defea8a5d34about-img.jpg', 'images/strategy/80754f9d671ed3265fd18defea8a5d34about-img2.jpg', 'STRATEGY OF SKILL EMPLOYMENT AND ENTREPRENEURSHIP DEPARTMENT', 'Our Strategy', '<h4 class=\"mb-20 fz-45 fw-700\" style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(59, 63, 130);font-family:&quot;Noto Sans&quot;, sans-serif;font-size:45px !important;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:700 !important;letter-spacing:normal;line-height:1.6;list-style:none;margin:0px 0px 20px !important;orphans:2;outline:none;padding:0px;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"><span style=\"font-size:13px;\"><span class=\"sub-title\" style=\"box-sizing:border-box;display:inline-block;letter-spacing:2px;list-style:none;margin:0px 0px 15px;outline:none;padding:0px;text-transform:uppercase;\">THE SKILL EMPLOYMENT AND ENTREPRENEURSHIP DEPARTMENT OF THE BODOLAND TERRITORIAL REGION (BTR) AIMS TO PROMOTE SKILL DEVELOPMENT, EMPLOYMENT GENERATION, AND ENTREPRENEURSHIP IN THE REGION. THE DEPARTMENT HAS IDENTIFIED SEVERAL STRATEGIES TO ACHIEVE ITS MISSION, INCLUDING: PROMOTING SKILL DEVELOPMENT, ENCOURAGING ENTREPRENEURSHIP, CREATING EMPLOYMENT OPPORTUNITIES,FOSTERING INNOVATION, BUILDING PARTNERSHIPS.</span></span></h4>', '2024-05-21');
INSERT INTO `who` (`id`, `image`, `name`, `designation`, `description`, `date_uploaded`) VALUES
(26, 'images/Who/4d23f876adc7d8752f13f4ba5b843b3dBtrCEM.jpg', 'Pramod Boro', 'CEM', '<p><span style=\"color:hsl(0,0%,0%);font-family:Montserrat, sans-serif;font-size:14px;\"><span style=\"-webkit-text-stroke-width:0px;display:inline !important;float:none;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:500;letter-spacing:normal;orphans:2;text-align:justify;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Pramod Boro (Born 1 March 1975) is an Indian politician serving as the president of The United People\'s Party Liberal (UPPL) since 25 February 2020 and Chief Executive Member of Bodoland Territorial Region, an autonomous region in Assam since 15 December 2020. He was the former president of All Bodo Students Union. Pramod Boro was born to Late Ghanashyam Boro. He is a resident of Tamulpur, Baksa district.As the CEM of BTC, Pramod Boro exemplifies a dedicated leader who is driven by the welfare of the people and the progress of the region. His efforts to bring about positive change and his commitment to inclusive development make him an influential figure in the Bodoland Territorial Council.</span></span></p>', '2024-05-01'),
(27, 'images/Who/4e1a9e0fe365ffbb4852351a2e4fb78eWilsonHasda.jpg', 'Wilson Hasda', 'EM', '<p><span style=\"font-family:Montserrat, sans-serif;font-size:14px;\"><span style=\"-webkit-text-stroke-width:0px;display:inline !important;float:none;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:500;letter-spacing:normal;orphans:2;text-align:justify;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Wilson Hasda is an esteemed individual who currently serves as an executive member of the Bodoland Territorial Council. He is affiliated with the United People\'s Party Liberal (UPPL) and has made significant contributions to the community as a social worker in various non-governmental organizations (NGOs).As an executive member of the Bodoland Territorial Council, Wilson Hasda plays a crucial role in the governance and decision-making processes. His deep understanding of social issues and his commitment to public service make him a valuable asset to the council</span></span></p>', '2024-05-09'),
(28, 'images/Who/001c00aa68028c77d04ce8aef6cfad2achd.jpg', 'Sri Lankeswar Owarie', 'CHD', '<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(0, 0, 0);font-family:Raleway, sans-serif;font-size:15px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:1rem;margin-top:0px;orphans:2;text-align:justify;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Bodoland Territorial Region (BTR) is an autonomous region within the state of Assam with the total population of 31,55,395 residing in 8970 sq km area. Like any other part of our great country, urbanization is posing problems in BTR as well.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(0, 0, 0);font-family:Raleway, sans-serif;font-size:15px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:1rem;margin-top:0px;orphans:2;text-align:justify;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Currently urban population of BTR is 1,50,530 (04.77% of the total population) and IS still increasing. The Region currently has 09 (nine) Municipal Boards (Kokrajhar, Fakiragram, Gossaigaon, Basugaon, Kajalgaon, Bijni, Goreswar, Tangla and Udalguri) and 01(one) Development Authority (Kokrajhar) to provide qualitative municipal services in Urban Areas.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(0, 0, 0);font-family:Raleway, sans-serif;font-size:15px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:1rem;margin-top:0px;orphans:2;text-align:justify;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">The urban Development Department of Bodoland Territorial Council (BTC), in close partnership with ULBs is striving to find innovative and advanced technological solutions to urban problems of the region like; integrated urban transport, Sanitation, Solid Waste Management, Urban Infrastructure, Urban Housing, Urban Planning, Financial Sustainability of ULBs and general Urban Governance.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(0, 0, 0);font-family:Raleway, sans-serif;font-size:15px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:1rem;margin-top:0px;orphans:2;text-align:justify;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">The task is gigantic; but the Department find it to be achievable through the active community involvement and hard work and sincere efforts of all officers and employees of the department.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(0, 0, 0);font-family:Raleway, sans-serif;font-size:15px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:1rem;margin-top:0px;orphans:2;text-align:justify;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Visitors of this website are humbly requested to give their valuable suggestions and feed back to assist the Department of Urban Development in its \"pursuit of excellence.\"</p>', '2024-05-23');
